import AppLayout from "../components/AppLayout";
import Link from 'next/link';

const Home =() =>{
    return (
        <AppLayout>
            <Link href="/about"><a>about!!!</a></Link>
            <div>Hello!</div>
        </AppLayout>
    );
};

export default Home;
